// Bootstrap CSS
import "bootstrap/dist/css/bootstrap.min.css";
import image_2 from "../Images/image_2.png";

function Contact() {
    return(
        <div style={{display:"flex", width:"70%", marginLeft:"15%", marginTop:"10px"}}>
            <div style={{background:"blue"}}>
                <div style={{width:"100%", background:"lavender", alignItems:"center", borderRadius:"15px", padding:"10px"}}>
                    <p style={{fontWeight:"bold", textAlign:"center", fontSize:"30px"}}>
                        Contact Us Because we love you
                    </p>
                </div>
            </div>
            
            <img src={image_2} style={{height:"20px", width:"70%", marginLeft:"15%"}} class="h-100" />
        </div>
    );
    
}

export default Contact;
